import React, { useState } from "react";

function SearchByArtist() {
  const [artist, setArtist] = useState("");
  const [results, setResults] = useState([]);

  const handleSearch = async () => {
    console.log(`Searching for artist: ${artist}`);
    try {
      const response = await fetch(`http://localhost:8080/api/fartists/search?keyword=${artist}`);
      if (response.ok) {
        const data = await response.json();
        console.log("Results:", data);
        setResults(data);
      } else {
        console.error("Error fetching data:", response.status);
      }
    } catch (error) {
      console.error("Fetch error:", error);
    }
  };

  return (
    <div className="search-page">
      <h2>Search By Artist</h2>
      <input
        type="text"
        placeholder="Enter artist name"
        value={artist}
        onChange={(e) => setArtist(e.target.value)}
        className="input-field"
      />
      <button onClick={handleSearch} className="button">
        Search
      </button>
      <div className="results">
        {results.length > 0 ? (
          results.map((artistItem) => (
            <div key={artistItem.artist_id}>
              <h3>{artistItem.artist_name}</h3>
              <p>{artistItem.artist_sort_name}</p>
              <p>{artistItem.artist_disambiguation}</p>
        
            </div>
          ))
        ) : (
          <p>No results found.</p>
        )}
      </div>
    </div>
  );
}

export default SearchByArtist;
